import './custombutton.scss'
import { withRouter } from 'react-router-dom'

const CustomButton = ({name, buttonUrlLink, history, ...otherProps}) => {
    return (
        <button className='custom-button' onClick={()=>history.push(buttonUrlLink)} {...otherProps}>{name}</button>
    )
}

export default withRouter(CustomButton)
